import React from 'react'; 

const Footer = () => {
    return (
        <div>

      
            <div id="contact" style={{ height: '10vh' }}></div>

                <div style={{ backgroundColor: '#2c3e50', height: '20vh'}}>
                    <div class="contact">
                        <h3> CONTACT </h3>
                        <p> TEL: 77 876 21 97</p>

                    </div>
                </div>
        </div>
    )

}

export default Footer;
